import { initializeApp } from 'firebase/app'
import { getAuth } from 'firebase/auth'
import { getFirestore } from 'firebase/firestore'
import { getStorage } from 'firebase/storage'

const firebaseConfig = {
  apiKey: "AIzaSyBnqPYBPEqBGKxQJBPGGRQXPOxZODSBXKw",
  authDomain: "novo-c0e6d.firebaseapp.com",
  projectId: "novo-c0e6d",
  storageBucket: "novo-c0e6d.appspot.com",
  messagingSenderId: "1095839316777",
  appId: "1:1095839316777:web:c8e1c3f5c0a9f5c6e0f0a0"
}

// Initialize Firebase
const app = initializeApp(firebaseConfig)

// Initialize Firebase services
const auth = getAuth(app)
const db = getFirestore(app)
const storage = getStorage(app)

// Export the services
export { auth, db, storage }
